import React, { Component } from 'react';
import {Route, NavLink} from 'react-router-dom';
import ExamplePage from './ExamplePage'
import ExamplePage2 from './ExamplePage2'

class Nav extends Component{
    render(){
        return(
            <header>
                <nav className="navigation-container">
                    <NavLink exact to="/"className="navigation-container-item">Home</NavLink>
                    <NavLink to="/"className="navigation-container-item">About us</NavLink>
                    <NavLink to=""className="navigation-container-item">Contact</NavLink>
                    <NavLink to=""className="navigation-container-item">Portfolio</NavLink>
                </nav>

            </header>
        );
    }
}

export default Nav;
